    title={SeriesData[0].title}
    series={SeriesData[0].series}
    link={SeriesData[0].link}
  />);
}

ReactDOM.render(
  <>
    <h1 className="heading_style">LIST OF TOP 5 NETFLIX SERIES</h1>


